import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import MyStatistics from '../basic/my.statistics';
import TotalStatistics from '../basic/total.statistics';


const useStyles = makeStyles({
    table: {
        width: 'fit-content',
        margin: 'auto',
    },
    tableHead: {
        fontSize: '1.2em',
        fontFamily: 'Century Gothic',
        background: '#E9ECEF',
    },
    tableData: {
        fontSize: '1em',
        fontFamily: 'Arial',
    },
    titles: {
        width: 'fit-content',
        margin: 'auto',
        fontSize: '2em',
        fontFamily: 'Century Gothic',
    },
  });

function Statistics() {
    const test = [
                    {"initials":"VM", "walkCount":5, "timeSpent": "7h53m", "uniqueAnimalsCount": 7, "points":325},
                    {"initials":"IZ", "walkCount":4, "timeSpent": "8h59m", "uniqueAnimalsCount": 10, "points":293},
                    {"initials":"KM", "walkCount":1, "timeSpent": "2h00m", "uniqueAnimalsCount": 2, "points":50},
                    {"initials":"ZG", "walkCount":8, "timeSpent": "10h00m", "uniqueAnimalsCount": 15, "points":550},
                    {"initials":"TT", "walkCount":5, "timeSpent": "8h00m", "uniqueAnimalsCount": 8, "points":400},
                    {"initials":"KG", "walkCount":20, "timeSpent": "30h00m", "uniqueAnimalsCount": 20, "points":1000},
                ];
    const classes = useStyles();
    var rang = 1;

    return (
        <div>
            <br/>
            <div className={classes.titles} >
                Rang lista šetača
            </div>
            <br/>
            <TableContainer component={Paper} className={classes.table}>
                <Table aria-label="simple table">
                    <TableHead>
                    <TableRow>
                        <TableCell align="center" className={classes.tableHead}>Rang</TableCell>
                        <TableCell align="center" className={classes.tableHead}>Inicijali građanina</TableCell>
                        <TableCell align="center" className={classes.tableHead}>Broj šetnji</TableCell>
                        <TableCell align="center" className={classes.tableHead}>Ukupna duljina šetnji</TableCell>
                        <TableCell align="center" className={classes.tableHead}>Broj pasa</TableCell>
                        <TableCell align="center" className={classes.tableHead}>Bodovi</TableCell>
                    </TableRow>
                    </TableHead>
                    <TableBody>
                    {test.map((row) => (
                        <TableRow key={row.initials}>
                            <TableCell align="center" className={classes.tableData}>{rang++}</TableCell>
                            <TableCell component="th" scope="row" align="center" className={classes.tableData}>
                                {row.initials}
                            </TableCell>
                            <TableCell align="center" className={classes.tableData}>{row.walkCount}</TableCell>
                            <TableCell align="center" className={classes.tableData}>{row.timeSpent}</TableCell>
                            <TableCell align="center" className={classes.tableData}>{row.uniqueAnimalsCount}</TableCell>
                            <TableCell align="center" className={classes.tableData}>{row.points}</TableCell>
                        </TableRow>
                    ))}
                    </TableBody>
                </Table>
            </TableContainer>
            <br/> <br/>

            <div className={classes.titles} >
                Osobna statistika
            </div>
            
            <div className={classes.table} >
                <br/>
                <MyStatistics></MyStatistics>
                <br/> <br/>
            </div>

            <div className={classes.titles} >
                Ukupna statistika stranice
            </div>

            <div className={classes.table}>
                <br/>
                <TotalStatistics></TotalStatistics>
                <br/> <br/>
            </div>
        </div>
    );
}

export default Statistics;
